import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { TabMenuModule } from 'primeng/tabmenu';
import { DialogModule } from 'primeng/dialog';
import { SharedModule } from 'app/shared/shared.module';
import { PanelModule } from 'primeng/panel';
import { DropdownModule } from 'primeng/dropdown';
import { FormsModule, ReactiveFormsModule } from '@angular/forms';
import { InputTextModule } from 'primeng/inputtext';
import { MultiSelectModule } from 'primeng/multiselect';
import { TableModule } from 'primeng/table';
import { ButtonModule } from 'primeng/button';
import { ConfirmPopupModule } from 'primeng/confirmpopup';
import { ToastModule } from 'primeng/toast';
import { TagModule } from 'primeng/tag';
import { RippleModule } from 'primeng/ripple';
import { DataEntryService } from 'app/workload/payroll-verifier/data-entry/service/data-entry.service';
import { ConfirmationService, MessageService } from 'primeng/api';
import { DateUtilsService } from 'app/core/util/date-utils.service';
import { DialogService } from 'primeng/dynamicdialog';
import { NspConfirmationService } from 'app/shared/confirm/nsp-confirm.service';
import { BankfileStopPaymentComponent } from './bankfile-stop-payment.component';
import {
  BankfileStopPaymentRoutingModule
} from 'app/payment/bankfile-stop-payment/route/bankfile-stop-payment-routing.module';
import { TabViewModule } from 'primeng/tabview';
import { StopPaymentComponent } from 'app/payment/bankfile-stop-payment/stop-payment/stop-payment.component';
import {
  StopPaymentFileUploadComponent
} from 'app/payment/bankfile-stop-payment/stop-payment/stop-payment-file-upload/stop-payment-file-upload.component';
import {
  KahRnsaReleaseHistoryComponent
} from './stop-payment/kah-rnsa-release-history/kah-rnsa-release-history.component';
import {
  StopPaymentManualInsertComponent
} from './stop-payment/stop-payment-manual-insert/stop-payment-manual-insert.component';
import { KahRnsaReleaseComponent } from './stop-payment/kah-rnsa-release/kah-rnsa-release.component';
import {
  ReleaseKahRnsaByNricComponent
} from './stop-payment/kah-rnsa-release/release-kah-rnsa-by-nric/release-kah-rnsa-by-nric.component';
import {
  ReleaseKahRnsaByAmountComponent
} from './stop-payment/kah-rnsa-release/release-kah-rnsa-by-amount/release-kah-rnsa-by-amount.component';
import { InputNumberModule } from 'primeng/inputnumber';
import { BankfileComponent } from './bankfile/bankfile.component';
import { BankfileFileUploadComponent } from './bankfile/bankfile-file-upload/bankfile-file-upload.component';
import { InstalmentBankfileComponent } from './instalment-bankfile/instalment-bankfile.component';
import {
  InstalmentBankfileFileUploadComponent
} from './instalment-bankfile/instalment-bankfile-file-upload/instalment-bankfile-file-upload.component';
import {
  InstalmentBankfileGenerateComponent
} from './instalment-bankfile/instalment-bankfile-generate/instalment-bankfile-generate.component';
import { CalendarModule } from 'primeng/calendar';
import { IcCodeService } from 'app/ng-connect';
import { ExportUtilsService } from 'app/core/util/export-utils.service';

@NgModule({
  declarations: [
    StopPaymentComponent,
    BankfileStopPaymentComponent,
    StopPaymentFileUploadComponent,
    KahRnsaReleaseHistoryComponent,
    StopPaymentManualInsertComponent,
    KahRnsaReleaseComponent,
    ReleaseKahRnsaByNricComponent,
    ReleaseKahRnsaByAmountComponent,
    BankfileComponent,
    BankfileFileUploadComponent,
    InstalmentBankfileComponent,
    InstalmentBankfileFileUploadComponent,
    InstalmentBankfileGenerateComponent,
  ],
  imports: [
    BankfileStopPaymentRoutingModule,
    CalendarModule,
    CommonModule,
    TabMenuModule,
    DialogModule,
    SharedModule,
    PanelModule,
    DropdownModule,
    FormsModule,
    ReactiveFormsModule,
    InputTextModule,
    InputNumberModule,
    MultiSelectModule,
    TableModule,
    ButtonModule,
    ConfirmPopupModule,
    ToastModule,
    TagModule,
    RippleModule,
    TabViewModule
  ],
  providers: [
    DataEntryService, ConfirmationService, MessageService, DateUtilsService, DialogService,
    NspConfirmationService, IcCodeService, ExportUtilsService]
})
export class BankfileStopPaymentModule {
}
